function generateDivs() {
    for (i = 0; i < numberSquaresH; i++) {
        for (j = 0; j < numberSquaresW; j++) {
            let subDiv = document.createElement(`div`);
            subDiv.id = "sub-div-id" + (j + i * numberSquaresW)
            subDiv.className = 'sub-div'
            subDiv.style.width = `${(width / numberSquaresW)}px`;
            subDiv.style.height = `${(height / numberSquaresW)}px`;
            //if (j + i * numberSquaresW == 0 || j + i * numberSquaresW == 4 || j + i * numberSquaresW == 20 || j + i * numberSquaresW == 24) {
            //    subDiv.style.content = `url("${letsQuizLogo}")`;
            //} else {
                
            
            
            // if (j + i * numberSquares == ((numberSquares * numberSquares)-1)/2 && numberSquares%2 !==0) {
            //     subDiv.style.content = `url("${letsQuizLogo}")`;
            // } else {
                subDiv.style.content = `url("${subArray[j + i * numberSquaresW]}")`;
            // }
            container.appendChild(subDiv);
        }
    }
    setDivListener();
}

function setDivListener() {
    subDivs = document.querySelectorAll(`.sub-div`);
    subDivs.forEach(subDiv => subDiv.addEventListener(`mousedown`, colorSubDiv));
    subDivs.forEach(subDiv => subDiv.addEventListener(`long-press`, NoColorSubDiv));
    subDivs.forEach(subDiv => subDiv.addEventListener(`dblclick`, NoColorSubDiv));
}

function colorSubDiv(e) {
    this.style.backgroundColor = `rgb(120,190,32,1)`   
}

function NoColorSubDiv(e) {
    this.style.backgroundColor = `rgb(255,255,255,1)`   
}
function otherColorSubDiv(e) {
    this.style.backgroundColor = `rgb(242,243,248,1))` 

}



function clearGrid() {
    subDivs.forEach(subDiv => subDiv.remove());
    generateDivs();
}

function getRandomSubarray(arr, size) {
    var shuffled = arr.slice(0), i = arr.length, temp, index;
    while (i--) {
        index = Math.floor((i + 1) * Math.random());
        temp = shuffled[index];
        shuffled[index] = shuffled[i];
        shuffled[i] = temp;
    }
    return shuffled.slice(0, size);
}

function preload(){
    subArray = getRandomSubarray(imageFiles, numberSquaresW * numberSquaresH);
    for (i = 0; i < numberSquaresW * numberSquaresH; i++) {
        image = new Image();
        image.src = subArray[i];
        imgArray.push(image);          
    }
}

